an; // If true; item will not be appeared in sidenav.\n  sub?: IChildItem[]; // Dropdown items\n  badges?: IBadge[];\n}\n\ninterface IChildItem {\n  type?: string;\n  name: string;       // Display text\n  state?: string;     // Router state\n  icon?: string;\n  sub?: IChildItem[];\n}\n\ninterface IBadge {\n  color: string;      // primary/accent/warn/hex color codes(#fff000)\n  value: string;      // Display text\n}\n\n@Injectable({\n  providedIn: 'root'\n})\nexport class NavigationService {\n  constructor() {\n  }\n\n  iconMenu: IMenuItem[] = [\n    {\n      name: 'Dashboard',\n      type: 'link',\n      tooltip: 'Dashboard',\n      icon: 'dashboard',\n      state: 'dashboard/blank'\n    },\n    {\n      name: 'Users',\n      type: 'link',\n      tooltip: 'users',\n      icon: 'group',\n      state: 'dashboard/users'\n    },\n    {\n      name: 'Patients',\n      type: 'link',\n      tooltip: 'patients',\n      icon: 'group',\n      state: 'dashboard/patients'\n    }\n  ];\n\n  // Icon menu TITLE at the very top of navigation.\n  // This title will appear if any icon type item is present in menu.\n  iconTypeMenuTitle = 'Frequently Accessed';\n  // sets iconMenu as default;\n  menuItems = new BehaviorSubject(this.iconMenu);\n  // navigation component has subscribed to this Observable\n  menuItems$ = this.menuItems.asObservable();\n\n  // Customizer component uses this method to change menu.\n  // You can remove this method and customizer component.\n  // Or you can customize this method to supply different menu for\n  // different user type.\n  publishNavigationChange(menuType: string) {\n    this.menuItems.next(this.iconMenu);\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/NotFoundComponent.html":{"url":"components/NotFoundComponent.html","title":"component - NotFoundComponent","body":"\n                   \n\n\n\n\n\n  Components\n 